import React from 'react';

const TaskList = ({ tasks, onDeleteTask }) => {
  return (
    <ul>
{tasks.map(task => (
  <div key={task.id}>
    <span>{task.title}</span>
    <span>{task.date}</span>
    <button onClick={() => handleEditTask(task)}>Edit</button>
    <button onClick={() => handleDeleteTask(task.id)}>Delete</button>
  </div>
))}
    </ul>
  );
};

export default TaskList;
